export const typesPosts = {
    POST: {
      PUSH: 'POST.PUSH',
      GET: 'POST.GET',
      GET_SUCCESS: 'POST.GET_SUCCESS'
    },
  }
  
  export const postPush = (email, postHeadline, postText) => ({
    type: typesPosts.POST.PUSH,
    email,
    postHeadline,
    postText,
  })
  
  export const postGet = () => ({
    type: typesPosts.POST.GET
  })

  export const postGetSuccess = (postDate, postHeadline, postText, postTime) => ({
    type: typesPosts.POST.GET_SUCCESS,
    postDate,
    postHeadline,
    postText,
    postTime,
  })
